            function sqr(x) { return x*x; }
            function approxDist(a, b) {
                // приближённая евклидова в градусах, для сравнения ближ/даль
                var dx = a[0] - b[0];
                var dy = a[1] - b[1];
                return dx*dx + dy*dy;
            }

            function focusNearest() {
                if (!navigator.geolocation) {
                    alert("Геолокация не поддерживается браузером.");
                    return;
                }
                navigator.geolocation.getCurrentPosition(function(pos) {
                    var lat = pos.coords.latitude;
                    var lon = pos.coords.longitude;
                    if (!SP_POINTS || SP_POINTS.length === 0) {
                        alert("Нет точек на карте.");
                        return;
                    }
                    var bestIdx = 0;
                    var bestD = approxDist([lat, lon], SP_POINTS[0]);
                    for (var i = 1; i < SP_POINTS.length; i++) {
                        var d = approxDist([lat, lon], SP_POINTS[i]);
                        if (d < bestD) {
                            bestD = d;
                            bestIdx = i;
                        }
                    }
                    var best = SP_POINTS[bestIdx];
                    // предположим, что глобальная переменная map существует (folium создаёт её)
                    try {
                        map.setView([best[0], best[1]], 16);
                        // добавим временный маркер/popup
                        var popup = L.popup()
                            .setLatLng([best[0], best[1]])
                            .setContent("Ближайшая точка")
                            .openOn(map);
                    } catch (e) {
                        console.error("Не удалось сфокусировать карту:", e);
                    }
                }, function(err) {
                    alert("Не удалось получить геопозицию: " + err.message);
                }, {enableHighAccuracy: true});
            }

            btn.style.left = "50%";
            btn.style.transform = "translateX(-50%)";
            btn.style.zIndex = "9999";
            btn.style.padding = "8px 12px";
            btn.style.background = "white";
            btn.style.border = "1px solid #888";
            btn.style.borderRadius = "8px";
            btn.style.boxShadow = "0 1px 4px rgba(0,0,0,0.3)";
            btn.onclick = focusNearest;
            document.body.appendChild(btn);
